const App = () => {
let dateCart = [
    {title: "HTML",discription: "Props are passed to components via HTML attributes.",  img: imgCart1},
   {title: "css",discription: "Props are passed to components via css attributes."},
   {title: "js",discription: "Props are passed to components via js attributes."},
]


    return (
      <div>
      <Navber></Navber>

      {
       
       dateCart.map((item) => {
         return (
           <CartDetails title={ item.title } discription={item.discription} image={item.img} />
         )
       })
        
      }

      </div>
    )

}

export default App;
